import React, { useState } from "react";

const Counter = () => {
  const [] = useState;
  return (
    <>
      <section className="counter">
        <div className="counter-btn">
          <div className="btn btn-success">++</div>&nbsp;&nbsp;
          <div className="btn btn-danger">--</div>
          <hr />
          <h1>0</h1>
        </div>
      </section>
    </>
  );
};

export default Counter;
